import ExNav from './navbar'

import 'bootstrap/dist/css/bootstrap.min.css';
import RequestWidget from './Popover';


const Layout = props => (
  <div >

  <ExNav></ExNav>

    {props.children}

    <RequestWidget></RequestWidget>        <style jsx>{`
      #Popover1{
        position: fixed;
        bottom: 0px;
        right: 0px; 
    }`}   </style>
  </div>
)

export default Layout
